import React, { useState } from "react";
import "./PropertyOwner.css";

const PropertyOwner = () => {
  const [showForm, setShowForm] = useState(false);
  const [formData, setFormData] = useState({
    title: "",
    address: "",
    price: "",
    description: "",
    images: [],
    questionnaire: {}
  });

  const questionnaireList = [
    "What's the preferred lease duration?",
    "Are utilities included in the rent?",
    "What's your pet policy?",
    "What amenities are included?",
    "What's your policy on subletting?"
  ];

  const handleImageUpload = (e) => {
    const files = Array.from(e.target.files);
    const imagesArray = files.map(file => ({
      name: file.name,
      data: URL.createObjectURL(file) // Convert to Base64 for local storage
    }));
    setFormData(prev => ({ ...prev, images: imagesArray }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    // Create FormData for file upload
    const submissionData = new FormData();
    for (const key in formData) {
      if (key === 'images') {
        formData.images.forEach(image => {
          submissionData.append('images', image);
        });
      } else {
        submissionData.append(key, formData[key]);
      }
    }

    try {
      // Send to backend
      const response = await fetch('http://localhost:3001/api/listings', {
        method: 'POST',
        body: submissionData
      });
      
      if (response.ok) {
        alert('Listing saved successfully!');
        setShowForm(false);
      }
    } catch (error) {
      console.error('Error saving listing:', error);
    }
  };

  return (
    <div className="property-owner-container">
      {/* Existing banner and content */}

      <div className="add-listing-section">
        <button 
          className="cta-button"
          onClick={() => setShowForm(!showForm)}
        >
          Add Rental Property
        </button>

        {showForm && (
          <form className="property-form" onSubmit={handleSubmit}>
            <h2>Property Listing Form</h2>
            
            {/* Basic Information */}
            <div className="form-group">
              <label>Property Title:</label>
              <input
                type="text"
                required
                onChange={(e) => setFormData({ ...formData, title: e.target.value })}
              />
            </div>

            {/* Image Upload */}
            <div className="form-group">
              <label>Upload Images:</label>
              <input
                type="file"
                multiple
                accept="image/*"
                onChange={handleImageUpload}
              />
              <div className="image-preview">
                {formData.images.map((image, index) => (
                  <img key={index} src={image.data} alt={image.name} />
                ))}
              </div>
            </div>

            {/* Questionnaire */}
            <div className="form-group">
              <h3>Property Details</h3>
              {questionnaireList.map((question, index) => (
                <div key={index} className="question-item">
                  <label>{question}</label>
                  <textarea
                    rows="3"
                    onChange={(e) => setFormData(prev => ({
                      ...prev,
                      questionnaire: {
                        ...prev.questionnaire,
                        [question]: e.target.value
                      }
                    }))}
                  />
                </div>
              ))}
            </div>

            <button type="submit" className="submit-button">Save Listing</button>
          </form>
        )}
      </div>
    </div>
  );
};

export default PropertyOwner;
